import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import AuthModals from './AuthModals';
import './Navbar.css';

const Navbar = ({
    searchTerm,
    onSearchChange,
    onClearSearch,
    resultsCount,
    isSearching,
    currentPage,
    onPageChange
}) => {
    const [isAuthModalOpen, setIsAuthModalOpen] = useState(false);
    const [authModalMode, setAuthModalMode] = useState('login');
    const { user, isAuthenticated, logout } = useAuth();
    const navigate = useNavigate();

    const handleLoginClick = () => {
        setAuthModalMode('login');
        setIsAuthModalOpen(true);
    };

    const handleSignUpClick = () => {
        setAuthModalMode('register');
        setIsAuthModalOpen(true);
    };

    const handleLogout = () => {
        logout();
        navigate('/');
    };

    const handleNavLinkClick = (page) => {
        if (onPageChange) {
            onPageChange(page);
        }
        // Clear search when navigating to different pages
        if (searchTerm && onClearSearch) {
            onClearSearch();
        }
    };

    const handleSearchInputChange = (e) => {
        if (onSearchChange) {
            onSearchChange(e.target.value);
        }
    };

    const handleClearSearchClick = () => {
        if (onClearSearch) {
            onClearSearch();
        }
    };

    return (
        <nav className="navbar">
            <div className="nav-container">
                {/* Logo/Brand */}
                <div className="nav-brand">
                    <Link to="/" onClick={() => handleNavLinkClick('home')}>
                        MovieHub
                    </Link>
                </div>

                {/* Navigation Links */}
                <div className="nav-links">
                    <Link
                        to="/"
                        className={currentPage === 'home' ? 'active' : ''}
                        onClick={() => handleNavLinkClick('home')}
                    >
                        Home
                    </Link>
                    <Link
                        to="/movies"
                        className={currentPage === 'movies' ? 'active' : ''}
                        onClick={() => handleNavLinkClick('movies')}
                    >
                        Movies
                    </Link>
                    <Link
                        to="/tv-series"
                        className={currentPage === 'tvseries' ? 'active' : ''}
                        onClick={() => handleNavLinkClick('tvseries')}
                    >
                        TV Series
                    </Link>
                    <Link
                        to="/top-imdb"
                        className={currentPage === 'topimdb' ? 'active' : ''}
                        onClick={() => handleNavLinkClick('topimdb')}
                    >
                        Top IMDB
                    </Link>
                </div>

                {/* Search Bar */}
                <div className="search-container">
                    <input
                        type="text"
                        placeholder="Search movies..."
                        value={searchTerm || ''}
                        onChange={handleSearchInputChange}
                        className="search-input"
                    />
                    {searchTerm && (
                        <button onClick={handleClearSearchClick} className="clear-search">
                            Ã—
                        </button>
                    )}
                </div>

                {/* Auth Section */}
                <div className="auth-section">
                    {isAuthenticated ? (
                        <div className="user-menu">
                            <Link
                                to="/profile"
                                className="profile-link"
                                onClick={() => handleNavLinkClick('profile')}
                            >
                                Welcome, {user?.username || 'User'}
                            </Link>
                            <button onClick={handleLogout} className="logout-btn">
                                Logout
                            </button>
                        </div>
                    ) : (
                        <div className="auth-buttons">
                            <button onClick={handleLoginClick} className="login-btn">
                                Login
                            </button>
                            <button onClick={handleSignUpClick} className="signup-btn">
                                Sign Up
                            </button>
                        </div>
                    )}
                </div>
            </div>

            {/* Search results info */}
            {isSearching && (
                <div className="search-results-info">
                    <span>Found {resultsCount} results for "{searchTerm}"</span>
                    <button onClick={handleClearSearchClick} className="clear-search-btn">
                        Clear Search
                    </button>
                </div>
            )}

            {/* Auth Modals */}
            <AuthModals
                isOpen={isAuthModalOpen}
                onClose={() => setIsAuthModalOpen(false)}
                initialMode={authModalMode}
            />
        </nav>
    );
};

export default Navbar;
